        <div className="h-screen">
            <div className='m-3'>
                <ul className='font-sans font-semibold flex flex-nowrap'>
                    <li><button className='border-b-green-400'>Tanymal</button></li>
                    <li className='pl-4'><button>Siz ushin</button></li>
                    <li className='pl-4'><button>Random</button></li>
                </ul>
            </div>

        </div>
    );
};

export default Counter;
